            function showtimur(){
               timur =   L.geoJSON(timur, {
                                style: function (feature) {
                        return {
                            fillOpacity: 0.55,
                            weight: 7,
                            color: '#eff682'
                        };
                    },
                    onEachFeature: function (feature, layer) {
                        layer.on({
                            'click': function (e) {
                                e.target.setStyle({
                                    weight: 7,
                                    color: 'rgba(0,0,0,0)'
                                });
                            }
